func testRetrievalToOnePeerUsingRetriever(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local Retrieval
	var foreign Peer

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, retrievalDBTypes, false, retrievalColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Retrieval struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, peerDBTypes, false, peerColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Peer struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	local.RetrieverID = foreign.ID
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.Retriever().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if check.ID != foreign.ID {
		t.Errorf("want: %v, got %v", foreign.ID, check.ID)
	}

	slice := RetrievalSlice{&local}
	if err = local.L.LoadRetriever(ctx, tx, false, (*[]*Retrieval)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Retriever == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.Retriever = nil
	if err = local.L.LoadRetriever(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Retriever == nil {
		t.Error("struct should have been eager loaded")
	}
}

